var b="url",c="【版本1_4、2_2、2_4、2_6、2_7】阳性案例审核.html",d="generationDate",e=new Date(1594728645112.88),f="defaultAdaptiveView",g="name",h="",i="size",j="width",k=0,l="height",m="adaptiveViews",n="sketchKeys",o="s0",p="variables",q="OnLoadVariable",r="currentTime",s="page",t="packageId",u="5d9aef801c7042f4bf231e313197627e",v="type",w="Axure:Page",x="【版本1.4、2.2、2.4、2.6、2.7】阳性案例审核",y="notes",z="annotations",A="fn",B="1",C="ownerId",D="ce6aa3d3ebfc4fcebdfac18480674bd8",E="label",F="审核通过",G="说明",H="<p><span>点击操作列中的“审核通过”，会弹出提示“是否确定审核通过？”，确定的话则数据状态改变为“XXXX（管理账号名称）&nbsp; 已审核”，取消则状态不变；</span></p><p><span>不允许跨级别审核，跨级别的管理机构看不到其他管理机构下属上报机构的的审核按钮</span></p><p><span><br></span></p>",I="2",J="dba758df10ec4aa7b72d0b294bb472f0",K="<p><span>点击操作列中的“审核通过”，会弹出提示“是否确定审核通过？”，确定的话则数据状态改变为“XXXX（管理账号名称）&nbsp; 已审核”，取消则状态不变；</span></p><p><span>不允许跨级别审核，跨级别的管理机构看不到其他管理机构下属上报机构的的审核按钮</span></p>",L="3",M="d39f4c76279048e8831ba86173585de5",N="退审",O="<p><span>点击操作列中的“退审”，会弹出提框，在弹框中输入“退审原因”，退审原因不允许为空，为必填项，输入后点击“确定”，则数据状态改变为“XXXX（管理账号名称）&nbsp; 已退审”，并显示对应的退审原因，点击“取消”则状态不变；</span></p><p><span>退审的数据，上报账号可以根据退审原因修改，修改后再次上报</span></p>",P="4",Q="050e3ee3ff024f1ca6a5469df232f93b",R="5",S="c8686502c2414cb79749d7ba84b50c8f",T="批量审核通过",U="<p><span>点击“批量审核通过”，会弹出提示“是否确定审核通过？”，确定的话则数据状态改变为“XXXX（管理账号名称）&nbsp; 已审核”，取消则状态不变；</span></p>",V="6",W="9d650e94783f487a85d32e2f42fb0aff",X="批量退审",Y="<p><span>点击“批量退审”，会弹出提框，在弹框中输入“退审原因”，退审原因不允许为空，为必填项，输入后点击“确定”，则数据状态改变为“XXXX（管理账号名称）&nbsp; 已退审”，并显示对应的退审原因，点击“取消”则状态不变；</span></p>",Z="7",ba="78f1fcd72f924f438ae677131f08bf6f",bb="所有数据",bc="<p><span>勾选“所有数据”，表示勾选当前列表中的所有可以审核的数据；（注意：下一级管理账号还未审核的数据是不允许选择的，没有复选框）</span></p>",bd="8",be="eb78f4db306b430dbe0426df9b23be47",bf="机构名称",bg="<p><span>机构名称列显示各级管理机构名称和上报机构名称，如果某个管理机构下所有的上报信息（包括直属于这个管理机构的上报账号上报的信息，以及下级管理机构中的上报账号上报的信息）都是已审核，那么需要在这个管理机构旁边显示“已审核”，如果不是所有数据都是已审核，则管理机构旁边不显示内容。</span></p><p><span>复选框代表选中状态，勾选为选中，勾选某个管理机构时，管理机构下所有的上报账号都为选中状态。</span></p>",bh="10",bi="2131d392cad64830918433bbc267eeeb",bj="(文本框)",bk="<p><span>默认当天，精确到天置灰，不允许修改。</span></p>",bl="11",bm="583dc7e4f84b41639f46ea6a880da91d",bn="<p><span>省份、城市、区县，不允许超过管理账号的区域范围</span></p>",bo="12",bp="c5644bc6d63a41db8c934cec5f9d0452",bq="<p><span>针对机构名称模糊匹配查询</span></p>",br="13",bs="1916db83f6f345a3b8debd0e621944ed",bt="(下拉列表)",bu="<p><span>未审核、已审核、已退审，默认为空，为空时表示查询所有状态的数据。</span></p>",bv="14",bw="8a71d8414738490eae50a051b949b289",bx="<p><span>账号状态是针对管理账号的状态（已审核或者是空）来查询的，默认查询的是“全部数据”，选择“已审核”则只会显示账号状态为“已审核”的数据，选择 空 则显示账号状态为空的数据。</span></p>",by="15",bz="4c871e462d4448818b9b24aab292a847",bA="查询",bB="<p><span>查询是触发式，默认刚刚打开页面时，列表都为空，不会进行查询，只有用户点击“查询”按键后，才会查询符合条件的数据。</span></p>",bC="16",bD="4c51015dc4ae4a9e8e7d8dfb2519f010",bE="导出 Excel",bF="<p><span>点击“导出 Excel”，会将当前页面中展示的数据导出到Excel表中。</span></p>",bG="17",bH="cf3f0a1c495b46e39d9c70ec01a7347e",bI="18",bJ="58e01e28ebb54206bc3ebacd23c43133",bK="19",bL="17f7318fa2f34af79cdf4b56e7cd9e26",bM="20",bN="6af3b2b69774481586f43f8d6d23dd5c",bO="style",bP="baseStyle",bQ="627587b6038d43cca051c114ac41ad32",bR="pageAlignment",bS="near",bT="fill",bU="fillType",bV="solid",bW="color",bX=0xFFFFFFFF,bY="image",bZ="imageAlignment",ca="imageRepeat",cb="auto",cc="favicon",cd="sketchFactor",ce="0",cf="colorStyle",cg="appliedColor",ch="fontName",ci="Applied Font",cj="borderWidth",ck="borderVisibility",cl="borderFill",cm=0xFF797979,cn="cornerRadius",co="cornerVisibility",cp="outerShadow",cq="on",cr=false,cs="offsetX",ct=5,cu="offsetY",cv="blurRadius",cw="r",cx=0,cy="g",cz="b",cA="a",cB=0.349019607843137,cC="adaptiveStyles",cD="interactionMap",cE="diagram",cF="objects",cG="id",cH="11ff72d7658c42c8a78594604033bf0d",cI="friendlyType",cJ="管理账号后台背景",cK="referenceDiagramObject",cL="styleType",cM="visible",cN=true,cO=1300,cP=819,cQ="imageOverrides",cR="masterId",cS="3c0c82fb53ce4cb2a4576c8f5a7ccc77",cT="7c6818e2ee704776b2f4d5fb5de3a189",cU="矩形",cV="vectorShape",cW="'微软雅黑', sans-serif",cX="fontWeight",cY="400",cZ=138,da=30,db="4b7bfc596114427989e10bb0b557d0ce",dc="location",dd="x",de=156,df="y",dg=59,dh="fontSize",di="12px",dj=0xFF